import React from "react";
import styles from "./ImageGallery.module.css";

const ImageGallery = (props) => {
  return (
    <div className={styles.container}>
      <img src={props.src1} />
      <img src={props.src2} />
      <img src={props.src3} />
    </div>
  );
};

export default ImageGallery;
